import * as React from 'react';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Navbar from '../Components/Navbar';

export default function Home() {
  return (
    <>
    <Navbar/>
    <Box
      sx={{
        display: 'flex',
        flexWrap: 'wrap',
        '& > :not(style)': {
          width: 1528,
          height:900,
          borderRadius:0,
        },
        justifyContent:'center'
      }}
    >
      <Paper elevation={3} />
    </Box>
    </>
  );
}
